ReactDOM.render(<h1>Hello Mayank!</h1>, document.getElementById("root"))
ReactDOM.render(<>
  <h1>Heading</h1>
  <p>Paragraph</p>
  <ul>
    <li>1</li>
    <li>2</li>
    <li>3</li>
    <li>4</li>
    <li>5</li>
